// Optimized search using pre-built index
let cityIndex = null;

function buildCityIndex() {
    if (cityIndex) return;

    cityIndex = new Map();

    CITIES.forEach((city, idx) => {
        // Index by first 2 characters of city name (lowercased)
        const prefix = city.city.toLowerCase().substring(0, 2);
        if (!cityIndex.has(prefix)) {
            cityIndex.set(prefix, []);
        }
        cityIndex.get(prefix).push(idx);

        // Also index by country first 2 chars
        const countryPrefix = city.country.toLowerCase().substring(0, 2);
        if (!cityIndex.has('c:' + countryPrefix)) {
            cityIndex.set('c:' + countryPrefix, []);
        }
        cityIndex.get('c:' + countryPrefix).push(idx);
    });
}

// Fuzzy search with index optimization
function fuzzySearch(query, cities, limit = 10) {
    if (!query || query.length === 0) return [];

    buildCityIndex();

    const lowerQuery = query.toLowerCase();
    const results = [];
    const seen = new Set();

    // Get candidate indices from index
    const prefix = lowerQuery.substring(0, 2);
    const candidateIndices = new Set();

    // Add cities matching the prefix
    if (cityIndex.has(prefix)) {
        cityIndex.get(prefix).forEach(idx => candidateIndices.add(idx));
    }

    // For short queries, also check single char prefix
    if (lowerQuery.length >= 1) {
        const singlePrefix = lowerQuery.substring(0, 1);
        cityIndex.forEach((indices, key) => {
            if (key.startsWith(singlePrefix) && !key.startsWith('c:')) {
                indices.forEach(idx => candidateIndices.add(idx));
            }
        });
    }

    // Also check country matches
    if (cityIndex.has('c:' + prefix)) {
        cityIndex.get('c:' + prefix).forEach(idx => candidateIndices.add(idx));
    }

    // If very few candidates, fall back to scanning more
    if (candidateIndices.size < 100 && lowerQuery.length <= 2) {
        // Add top 500 cities by population as fallback
        for (let i = 0; i < Math.min(500, CITIES.length); i++) {
            candidateIndices.add(i);
        }
    }

    // Score candidates
    for (const idx of candidateIndices) {
        const cityData = CITIES[idx];
        const cityLower = cityData.city.toLowerCase();
        const countryLower = cityData.country.toLowerCase();

        let score = 0;

        // Exact match at start gets highest priority
        if (cityLower.startsWith(lowerQuery)) {
            score = 1000 - cityLower.length;
        }
        // Contains the query
        else if (cityLower.includes(lowerQuery)) {
            score = 500 - cityLower.indexOf(lowerQuery);
        }
        // Country match
        else if (countryLower.startsWith(lowerQuery)) {
            score = 250;
        }
        else if (countryLower.includes(lowerQuery)) {
            score = 100;
        }

        if (score > 0) {
            const key = cityData.city + '|' + cityData.country;
            if (!seen.has(key)) {
                seen.add(key);
                results.push({ ...cityData, score });
            }
        }
    }

    // Sort by score descending, then alphabetically
    results.sort((a, b) => {
        if (b.score !== a.score) return b.score - a.score;
        return a.city.localeCompare(b.city);
    });

    return results.slice(0, limit);
}

// Find a city by name (exact or close match)
function findCity(name) {
    const lowerName = name.toLowerCase();
    return CITIES.find(c => c.city.toLowerCase() === lowerName);
}

// Get city by ID (using city name as ID for simplicity)
function getCityId(cityData) {
    return cityData.city.toLowerCase().replace(/\s+/g, '-');
}
